import React from "react";
import {Link} from "react-router-dom";
import {ROUTES} from "../../routes/constants";

const Header: React.FC = () => {
  return (
    <div className="bg-white h-20  shadow-md">
      <div className="flex">
        <div className="flex-1 w-1/2 text-2xl  text-gray-600 font-bold mx-5 my-5">Movies DB</div>
        <div className="flex-none w-1/2 text-sm font-normal hover:text-rose-600 mx-7 my-7"><Link to={ROUTES.HOME}>HOME</Link></div>
        <div className="flex-none w-5 text-sm font-normal hover:text-rose-600 mx-7 my-7"><Link to={ROUTES.POPULAR}>POPULAR</Link></div>
        <div className="flex-none w-5 text-sm font-normal hover:text-rose-600 mx-7 my-7"><Link to={ROUTES.TOP_RATED}>TOP RATED</Link></div>
        <div className="flex-none w-5 text-sm font-normal hover:text-rose-600 mx-7 my-7"><Link to={ROUTES.NOW_PLAYING}>NOW PLAYING</Link></div>
        <div className="flex-none w-5 text-sm font-normal hover:text-rose-600 mx-7 my-7"><Link to={ROUTES.MY_FAVORITES}>MY FAVORITES</Link></div>
      </div>
    </div>

  );
}

export default Header;
